2	2	441	PT. JASINDO DUTA SEGARA recruitment process.	<p><span style="font-size: 18px;"><strong>Good day seafarers !!</strong></span></p>\n<p></p>\n<p>This is PT. Jasindo Duta Segara and we are located in Kelapa Gading, Ruko Inkopal Blok C No. 55.</p>\n<p>We have a recruitment process for new joiners and please kindly refer to the below information :</p>\n<p>1. ONLY REQUIRED CANDIDATE can proceed and will be replied to by our team.&nbsp;</p>\n<p>2. Please kindly read our criteria in every job vacancy to make our team easier to find the suitable candidate.&nbsp;</p>\n<p>3. After screening your CV, our team will call you or send a whatsapp message to verify your data.&nbsp;</p>\n<p>4. Interview process for 2 times by phone call or whatsapp video.&nbsp;</p>\n<p>5. No Charge for every new joinee in our company, please let us know if there is someone asking for money during the recruitment process.&nbsp;</p>\n<p>6. After passing 2 interviews, our team will inform you to drop your document to our company.&nbsp;</p>\n<p>7. Document will be checked and informed if there is any invalid or fake document.&nbsp;</p>\n<p></p>\n<p>Based on the above, please kindly note that many candidate send us their CV everyday.&nbsp;</p>\n<p>We can only proceed with the qualified candidate based on our criteria in every position.&nbsp;</p>\n<p>Thank you seafarers, Good luck !!</p>\n<p></p>\n<p>Best regards</p>\n<p>Crewing department of PT. Jasindo Duta Segara</p>	2023-09-27 02:56:38	2023-09-27 02:56:38
